    this.GradientDirection = function (val) {
        gradient = [];
        gradient[0] = "to right";
        gradient[1] = "to left";
        gradient[2] = "to bottom";
        gradient[3] = "to bottom right";
        gradient[4] = "to bottom left";
        gradient[5] = "to top right";
        gradient[6] = "to top left";

        return gradient[val];
    };
